script: |
  super -f text -I q6526.spq | sort > q6526.out

inputs:
  - name: q6526.spq
    data: |
      SELECT DISTINCT + - 90 AS col1 FROM tab2 (FORMAT parquet) WHERE - - col0 * - + col2 * - col0 + - 26 NOT BETWEEN NULL AND 50 - col0;
  - name: tab2

outputs:
  - name: q6526.out
    data: |
      -90
